class ListNode:
    def __init__(self,x):
        self.val=x
        self.next=None

class Problem21:
    def mergeTwoLists(self, l1, l2):
        p=l1
        q=l2
        t=None
        head=None
        while p!=None or q!=None:
            if q==None or (p!=None and p.val<=q.val):
                tp=ListNode(p.val)
                if t==None: 
                    head=tp
                    t=tp
                else:
                    t.next=tp
                    t=t.next
                p=p.next
            else:
                tp=ListNode(q.val)
                if t==None:
                    head=tp
                    t=tp
                else:
                    t.next=tp
                    t=t.next
                q=q.next
        return head
    
