class Problem22:
    def generateParentthesis(self,n):
        rets=set()
        def Parent(s,left,right,rets):
            if left+right==n*2:
                return rets.add(s)
            if left<n:
                Parent(s+'(',left+1,right,rets)
            if right<left:
                Parent(s+')',left,right+1,rets)
        Parent('',0,0,rets)
        return list(rets)

