class Problem23:
    def mergeKLists(self,l):
        m=None
        if len(l)==0:
            return None
        elif len(l)==1:
            m=l[0]
        elif len(l)==2:
            m=self.mergeTwoList(l[0],l[1])
        else:
            p1=l[0:(len(l)//2)]
            p2=l[(len(l)//2):len(l)]
            m=self.mergeKLists([self.mergeKLists(p1),self.mergeKLists(p2)])
        return m
            
    def mergeTwoList(self,l1,l2):
        p=l1
        q=l2
        t=None
        head=None
        while p!=None or q!=None:
            if q==None or (p!=None and q!=None and p.val<=q.val):
                tp=ListNode(p.val)
                if t==None: 
                    head=tp
                    t=tp
                else:
                    t.next=tp
                    t=t.next
                p=p.next
            else:
                tp=ListNode(q.val)
                if t==None:
                    head=tp
                    t=tp
                else:
                    t.next=tp
                    t=t.next
                q=q.next
        return head
        
   
