class Problem24:
    def swapPairs(self,head):
        k=0
        first=head
        tail=None
        while first!=None:
            if first.next !=None:
                second=first.next
                if k==0:
                    first.next=second.next
                    head=second
                    second.next=first
                    tail=first
                    first=first.next
                elif k%2==0 and k!=0:
                    first.next=second.next
                    tail.next=second
                    second.next=first
                    first=first.next
                    tail=tail.next.next
                k +=2
            #个数为奇数时，单个的处理        
            else:
                if k==0: return head
                else:
                    k +=1
                    tail.next=first
                    break
        return head               
                    
