class Problem25:
    def reverseKGroup(self,head,k):
        all=0
        first=head
        tail=None
        while first!=None:
            temp=first
            ck=1
            while temp.next!=None and ck<k:
                temp=temp.next
                ck +=1
            all +=ck
            if ck%k==0:
                start=first
                end=temp
                if temp==None:
                    newstart=None
                else:
                    newstart=temp.next
                if all<=k:
                    head=end
                    tp=head
                    while start!=end:
                        start,end=self.swapPairs(start,end)
                        if start!=head:
                            tp.next=start
                            tp=tp.next
                        start=start.next
                    tp.next=end
                    end.next=newstart
                    first=newstart
                    tail=end
                else:
                    tail.next=end
                    tp=end
                    while start!=end:
                        start,end=self.swapPairs(start,end)
                        if start!=tail.next:
                            tp.next=start
                            tp=tp.next
                        start=start.next
                    tp.next=end
                    end.next=newstart
                    first=newstart
                    tail=end
            else:
                if tail!=None:tail.next=first
                break
        return head
    
    def swapPairs(self, start, end):
        temp= start
        while temp.next!=end:
            temp=temp.next
        end.next=start
        start=end
        end=temp
        return start,end
            
