class Problem26:
    def removeDuplicates(self,nums):
        leng=0
        pt=0
        if len(nums)==0: return 0
        while pt < len(nums):
            if nums[pt]!=nums[leng]:
                leng +=1
                nums[leng]=nums[pt]
            pt +=1
        return leng+1

