class Problem27:
    def removeElement(self, nums, val):
        leng=0
        pt=0
        if len(nums)==0: return 0
        while pt<len(nums):
            if nums[pt]!=val:
                nums[leng]=nums[pt]
                leng +=1
            pt +=1
        return leng

