class Problem28:
    def strStr(self, haystack, needle):
        indx=-1
        flag=0
        pt=0
        if len(needle)==0: return 0
        while pt<len(haystack):
            ptt=pt
            ptn=-1
            if len(haystack)-pt<len(needle):
                break
            elif haystack[pt]==needle[0]:
                ptn=0
                flag=pt
                while ptt<len(haystack) and ptn<len(needle) and haystack[ptt]==needle[ptn]:
                    ptt +=1
                    ptn +=1
                if ptn==len(needle):
                    indx=flag
                    break
                else: indx=-1
            pt+=1
        return indx
        
