#这里取巧用了range函数，理论上是用位运算，每次求出2的指数次最大位值，比如3<<1的值为6
class Problem29:
    def divide(self, dividend, divisor):
        flag = -1 if dividend*divisor <0 else 1
        if dividend>=2**31: dividend=2**31-1
        if dividend<-2**31: dividend=-2**31
        dividend=abs(dividend)
        divisor=abs(divisor)
        if dividend < divisor: return 0
        elif dividend == divisor: return flag
        elif divisor==1: return flag*dividend if flag*dividend<2**31 else 2**31-1
        else:
            a=range(dividend,0,-1*divisor)
            if a[len(a)-1]<divisor: return flag*(len(a)-1) 
            else:return flag*len(a)

