from collections import defaultdict

class Problem30:
    def findSubstring(self,s,words):
        """
        :type s: str
        :type words: List[str]
        :rtype: List[int]
        """
        indx=[]
        if len(words)==0 or len(s)<len(words)*len(words[0]): return indx
        map_dict=defaultdict(int)
        cur_dict=defaultdict(int)
        word_len=len(words[0])
        total_len=len(words)*len(words[0])
        str_len=len(s)
        #计算words总的长度，和每个单词的词典
        for word in words:
            map_dict[word]+=1
        for start in range(0,str_len-total_len+1):
            end=start
            while end<start+total_len:
                sub_str=s[end:end+word_len]
                cur_dict[sub_str]+=1
                if cur_dict[sub_str]>map_dict[sub_str]:
                    break
                end+=word_len
            if end==start+total_len:
                indx.append(start)
            cur_dict.clear()
        return indx
    
